use crate::board::constants::SquareShiftBits;

mod generator;

pub type Magics = [MagicConfiguration; 64];

pub trait UnsafeMagicsExt {
    fn get_attacks(&self, square: SquareShiftBits, occupancy: u64) -> u64;
}

impl UnsafeMagicsExt for Magics {
    #[inline(always)]
    fn get_attacks(&self, square: SquareShiftBits, occupancy: u64) -> u64 {
        unsafe {
            self.get_unchecked(square as usize).get_attacks(occupancy)
        }
    }
}

pub struct MagicConfiguration {
    mask: u64,
    magic: u64,
    hash_mask: u64,
    hash_shift: u32,
    attacks: &'static [u64],
}

impl MagicConfiguration {
    const fn new(mask: u64, magic: u64, hash_mask: u64, hash_shift: u32, attacks: &'static [u64]) -> Self {
        Self { mask, magic, hash_mask, hash_shift, attacks }
    }

    #[inline(always)]
    unsafe fn get_attacks(&self, occupancy: u64) -> u64 {
        *self.attacks.get_unchecked(self.hash(occupancy))
    }

    #[inline(always)]
    fn hash(&self, occupancy: u64) -> usize {
        magic_hash(self.mask, self.hash_shift, self.hash_mask, self.magic, occupancy)
    }
}

