fn magic_hash(mask: u64, hash_shift: u32, hash_mask: u64, magic: u64, occupancy: u64) -> usize {
    let i1 = occupancy & mask;
    let i2 = i1.overflowing_mul(magic).0;
    let i3 = i2 >> hash_shift;
    let i4 = i3 & hash_mask;
    i4 as usize
}
